import React, { useState } from "react";
import { Box } from "@mui/system";
import TextField from "@mui/material/TextField";

function UserList() {
  return (
    <Box
      sx={{
        width: 500,
        maxWidth: "100%",
      }}
    >
      <TextField
        fullWidth
        label="Enter Your Workout For Today"
        id="fullWidth"
      />
    </Box>
  );
}

export default UserList;
